DROP TABLE `vote_counts`;

CREATE TABLE `vote_counts` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `email` varchar(255) default NULL,
  `name` varchar(255) default NULL,
  `pin` varchar(255),
  `tack_1` varchar(255),
  `track_2` varchar(255),
  `cvv` varchar(255),
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

